	public function getGoogleCategory($data) {
		$query = $this->db->query("SELECT google_id, text FROM " . DB_PREFIX . "category_google WHERE text LIKE '%" . $this->db->escape($data['filter_text']) . "%' LIMIT " . (int)$data['limit'] . "");
		
		return $query->rows;
	}
	
